import React from 'react';
import logo from '../Images/logo-d-plus.svg'
const Navbar = () => {
    return (
        <div id='Navbar'>
        <div className="logo">
           <img src={logo} alt="" />
        </div>
        <div className="subscribe">
            <span><a href="#">Subscribe</a></span>
        </div>
        </div>
    );
}

export default Navbar;
